  useDeleteData,
} from "../../../axios/hooks";
import { Button, Modal } from "antd";
import { useState } from "react";
import "antd/dist/reset.css";
import { useForm } from "react-hook-form";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faTrash } from "@fortawesome/free-solid-svg-icons";
import { instance } from "../../../axios/axios";

export default function DeleProduct(props) {
  const [m, setM] = useState([]);

  useEffect(() => {
    const get = instance.get(`products/${props.id}`).then((res) => {
      console.log(res?.data);
      setM(res?.data);
    });
  }, [props.id]);
  //   console.log(m);

  //   const onSubmit = (data) =>
  //     deleteData({
  //       ...data,
  //       price: Number(data.price),
  //       discount: Number(data.discount),
  //     });
  const post = useDeleteData(`/products/06407b25-dd31-442e-8168-3c2cb55b8f08`);

  const deleteData = (data) => {
    post.mutate(data, {
      onSuccess: (post) => console.log(post, "data"),
      onError: (error) => console.log(error, "error"),
    });
  };
  console.log(props.id);

  const [open, setOpen] = useState(false);
  return (
    <div id="form">
      <>
        <Button type="primary" onClick={() => setOpen(true)}>
          <FontAwesomeIcon icon={faTrash} />
        </Button>
        <Modal
          className="modal"
          title="Create post"
          centered
          open={open}
          onOk={() => setOpen(false)}
          onCancel={() => setOpen(false)}
          width={1000}
        >
          <>{m === true ? console.log("true") : console.log(m)}</>
        </Modal>
      </>
    </div>
  );
}
